var openai2 = new OpenAI({
  apiKey: process.env.OPENAI_API_KEY || ""
});
var openAiModel2 = process.env.OPENAI_MODEL || "gpt-4-1106-preview";
async function generateFollowupQuestion(context) {
  if (!process.env.OPENAI_API_KEY) {
    console.warn("OpenAI API key not configured, using mock follow-up generation");
    return generateMockFollowup(context);
  }
  try {
    const prompt = buildFollowupPrompt(context);
    const completion = await openai2.chat.completions.create({
      model: openAiModel2,
      messages: [{ role: "system", content: prompt }],
      temperature: 0.7,
      max_tokens: 200
    });
    const response = completion.choices[0]?.message?.content;
    if (!response) {
      throw new Error("No response from OpenAI");
    }
    const shouldContinue = context.journal.followupCount < context.journal.maxFollowups - 1;
    return {
      question: response.trim(),
      shouldContinue
    };
  } catch (error39) {
    console.error("Error generating follow-up question:", error39);
    return generateMockFollowup(context);
  }
}
async function processJournalSubmission(context) {
  if (!process.env.OPENAI_API_KEY) {
    console.warn("OpenAI API key not configured, using mock journal processing");
    return generateMockSummary(context);
  }
  try {
    const prompt = buildSummaryPrompt(context);
    const completion = await openai2.chat.completions.create({
      model: openAiModel2,
      messages: [{ role: "system", content: prompt }],
      temperature: 0.3,
      max_tokens: 800
    });
    const response = completion.choices[0]?.message?.content;
    if (!response) {
      throw new Error("No response from OpenAI");
    }
    return parseGPTSummaryResponse(response, context);
  } catch (error39) {
    console.error("Error processing journal submission:", error39);
    return generateMockSummary(context);
  }
}
function buildFollowupPrompt(context) {
  const { user, journal } = context;
  const conversationHistory = journal.conversationHistory || [];
  let prompt = `You are a thoughtful, empathetic journaling companion helping ${user.name} reflect on their experiences. `;
  prompt += `Your role is to ask one insightful follow-up question that helps them go deeper into their thoughts and feelings.

`;
  prompt += `CONVERSATION SO FAR:
`;
  conversationHistory.forEach((msg, index) => {
    const speaker = msg.role === "user" ? user.name : "You";
    prompt += `${speaker}: ${msg.content}
`;
  });
  prompt += `
GUIDELINES:
`;
  prompt += `- Ask ONE thoughtful follow-up question (not multiple questions)
`;
  prompt += `- Be empathetic and encouraging
`;
  prompt += `- Help them explore emotions, insights, or connections they might not have considered
`;
  prompt += `- Keep the tone conversational and supportive
`;
  prompt += `- Don't repeat questions or topics already covered
`;
  prompt += `- The question should be 1-2 sentences maximum

`;
  prompt += `Your follow-up question:`;
  return prompt;
}
function buildSummaryPrompt(context) {
  const { user, journal, userAttributes, existingTags } = context;
  const conversationHistory = journal.conversationHistory || [];
  let prompt = `You are processing a complete journal conversation for ${user.name}. `;
  prompt += `Create a cohesive summary and extract metadata.

`;
  prompt += `COMPLETE CONVERSATION:
`;
  conversationHistory.forEach((msg, index) => {
    const speaker = msg.role === "user" ? user.name : "Assistant";
    prompt += `${speaker}: ${msg.content}
`;
  });
  prompt += `
USER CONTEXT:
`;
  if (userAttributes.length > 0) {
    prompt += `Existing attributes: ${userAttributes.map((attr) => `${attr.key}: ${attr.value}`).join(", ")}
`;
  }
  if (existingTags.length > 0) {
    prompt += `Existing tags: ${existingTags.map((tag) => tag.name).join(", ")}
`;
  }
  prompt += `
TASK:
`;
  prompt += `1. Write a cohesive summary in ${user.name}'s voice that captures the key insights and experiences
`;
  prompt += `2. Extract 2-5 relevant tags (prefer existing tags when appropriate)
`;
  prompt += `3. Suggest 0-2 new user attributes based on insights (avoid duplicating existing attributes)
`;
  prompt += `4. Analyze overall emotional sentiment on a scale of 1-5 (1=very negative, 3=neutral, 5=very positive)
`;
  prompt += `5. Extract 1-3 mood tags that capture the emotional tone (e.g., "calm", "anxious", "energized", "content", "frustrated", "excited", "peaceful", "stressed")

`;
  prompt += `RESPONSE FORMAT (JSON):
`;
  prompt += `{
`;
  prompt += `  "summary": "A cohesive journal summary written in first person...",
`;
  prompt += `  "extractedTags": ["tag1", "tag2", "tag3"],
`;
  prompt += `  "suggestedAttributes": [
`;
  prompt += `    {"key": "category", "value": "specific insight"},
`;
  prompt += `    {"key": "preference", "value": "discovered preference"}
`;
  prompt += `  ],
`;
  prompt += `  "sentimentScore": 4,
`;
  prompt += `  "moodTags": ["energized", "content"]
`;
  prompt += `}

`;
  prompt += `Return only the JSON response:`;
  return prompt;
}
function parseGPTSummaryResponse(response, context) {
  try {
    const jsonMatch = response.match(/\{[\s\S]*\}/);
    if (!jsonMatch) {
      throw new Error("No JSON found in response");
    }
    const parsed = JSON.parse(jsonMatch[0]);
    return {
      summary: parsed.summary || "Summary could not be generated.",
      extractedTags: Array.isArray(parsed.extractedTags) ? parsed.extractedTags : [],
      suggestedAttributes: Array.isArray(parsed.suggestedAttributes) ? parsed.suggestedAttributes : [],
      sentimentScore: typeof parsed.sentimentScore === "number" ? Math.max(1, Math.min(5, parsed.sentimentScore)) : 3,
      moodTags: Array.isArray(parsed.moodTags) ? parsed.moodTags : []
    };
  } catch (error39) {
    console.error("Error parsing GPT summary response:", error39);
    return generateMockSummary(context);
  }
}
function generateMockFollowup(context) {
  const mockQuestions = [
    "What emotions came up for you during that experience?",
    "How does this connect to what you value most in life?",
    "What would you like to remember most about today?",
    "What surprised you about your reaction to this situation?",
    "How do you feel this experience has changed your perspective?"
  ];
  const randomQuestion = mockQuestions[Math.floor(Math.random() * mockQuestions.length)];
  const shouldContinue = context.journal.followupCount < context.journal.maxFollowups - 1;
  return {
    question: randomQuestion,
    shouldContinue
  };
}
function generateMockSummary(context) {
  const conversationHistory = context.journal.conversationHistory || [];
  const userContent = conversationHistory.filter((msg) => msg.role === "user").map((msg) => msg.content).join(" ");
  return {
    summary: `Today I reflected on ${userContent.slice(0, 200)}...`,
    extractedTags: ["reflection", "personal-growth"],
    suggestedAttributes: [],
    sentimentScore: 3,
    moodTags: ["reflective"]
  };
}

