async function processExtractedTags(userId, tagNames, journalId) {
  const processedTags = [];
  for (const tagName of tagNames) {
    let existingTag = await db.query.tags.findFirst({
      where: and(eq(tags.userId, userId), eq(tags.name, tagName.toLowerCase()))
    });
    if (!existingTag) {
      const [newTag] = await db.insert(tags).values({
        userId,
        name: tagName.toLowerCase()
      }).returning();
      existingTag = newTag;
    }
    await db.insert(tagAssociations).values({
      tagId: existingTag.id,
      entityType: "journal",
      entityId: journalId
    });
    processedTags.push(existingTag);
  }
  return processedTags;
}
async function processSuggestedAttributes(userId, suggestedAttributes) {
  const processedAttributes = [];
  for (const attr of suggestedAttributes) {
    const existingAttribute = await db.query.attributes.findFirst({
      where: and(eq(attributes.userId, userId), eq(attributes.key, attr.key), eq(attributes.value, attr.value))
    });
    if (!existingAttribute) {
      const [newAttribute] = await db.insert(attributes).values({
        userId,
        key: attr.key,
        value: attr.value
      }).returning();
      processedAttributes.push(newAttribute);
    }
  }
  return processedAttributes;
}
