// src/utils/potionAnalysis.ts
var openai3 = new OpenAI({
  apiKey: process.env.OPENAI_API_KEY || ""
});
var openAiModel3 = process.env.OPENAI_MODEL || "gpt-4-1106-preview";
async function analyzePotionEffectiveness(potionId) {
  if (!process.env.OPENAI_API_KEY) {
    console.warn("OpenAI API key not configured, using mock potion analysis");
    return generateMockAnalysis();
  }
  try {
    const potion = await db.query.potions.findFirst({
      where: eq(potions.id, potionId)
    });
    if (!potion) {
      throw new Error("Potion not found");
    }
    const linkedJournals = await db.query.journals.findMany({
      where: and(eq(journals.potionId, potionId), eq(journals.status, "completed"), isNotNull(journals.sentimentScore))
    });
    const linkedTasks = await db.query.tasks.findMany({
      where: and(eq(tasks.potionId, potionId), eq(tasks.status, "complete"))
    });
    if (linkedJournals.length === 0 && linkedTasks.length === 0) {
      return {
        effectiveness: "insufficient_data",
        summary: "Not enough data collected during this potion period to make an assessment.",
        journalTrends: "No journal entries linked to this potion.",
        taskTrends: "No task completions linked to this potion.",
        recommendations: "Continue using this potion for a longer period to gather more data."
      };
    }
    const context = {
      potion,
      linkedJournals,
      linkedTasks
    };
    const prompt = buildAnalysisPrompt(context);
    const completion = await openai3.chat.completions.create({
      model: openAiModel3,
      messages: [{ role: "system", content: prompt }],
      temperature: 0.3,
      max_tokens: 1000
    });
    const response = completion.choices[0]?.message?.content;
    if (!response) {
      throw new Error("No response from OpenAI");
    }
    return parseAnalysisResponse(response);
  } catch (error39) {
    console.error("Error analyzing potion effectiveness:", error39);
    return generateMockAnalysis();
  }
}
function buildAnalysisPrompt(context) {
  const { potion, linkedJournals, linkedTasks } = context;
  let prompt = `You are analyzing the effectiveness of a personal experiment (called a "Potion") based on mood and productivity data.

`;
  prompt += `POTION DETAILS:
`;
  prompt += `Title: ${potion.title}
`;
  if (potion.hypothesis) {
    prompt += `Hypothesis: ${potion.hypothesis}
`;
  }
  prompt += `Duration: ${potion.startDate} to ${potion.endDate}

`;
  if (linkedJournals.length > 0) {
    prompt += `JOURNAL SENTIMENT DATA (${linkedJournals.length} entries):
`;
    linkedJournals.forEach((journal, index) => {
      prompt += `Entry ${index + 1}: Sentiment ${journal.sentimentScore}/5`;
      if (journal.moodTags && journal.moodTags.length > 0) {
        prompt += `, Mood: ${journal.moodTags.join(", ")}`;
      }
      prompt += `
`;
    });
    prompt += `
`;
  }
  if (linkedTasks.length > 0) {
    prompt += `TASK COMPLETION DATA (${linkedTasks.length} completions):
`;
    linkedTasks.forEach((task, index) => {
      prompt += `Task ${index + 1}: "${task.title}" - Status: ${task.status}`;
      if (task.moodScore) {
        prompt += `, Energy/Mood: ${task.moodScore}/5`;
      }
      if (task.emotionTag) {
        prompt += `, Emotion: ${task.emotionTag}`;
      }
      if (task.feedback) {
        prompt += `, Feedback: "${task.feedback}"`;
      }
      prompt += `
`;
    });
    prompt += `
`;
  }
  prompt += `ANALYSIS TASK:
`;
  prompt += `Analyze whether this potion appears to be effective based on the data. Consider:
`;
  prompt += `1. Average sentiment scores and mood trends from journals
`;
  prompt += `2. Task completion rates and energy levels
`;
  prompt += `3. Emotional feedback and user experience
`;
  prompt += `4. Overall patterns that suggest positive or negative impact

`;
  prompt += `RESPONSE FORMAT (JSON):
`;
  prompt += `{
`;
  prompt += `  "effectiveness": "likely_effective" | "mixed_results" | "likely_ineffective" | "insufficient_data",
`;
  prompt += `  "summary": "Overall assessment in 1-2 sentences",
`;
  prompt += `  "journalTrends": "Summary of mood/sentiment patterns from journals",
`;
  prompt += `  "taskTrends": "Summary of task completion and energy patterns",
`;
  prompt += `  "recommendations": "Actionable suggestions for next steps"
`;
  prompt += `}

`;
  prompt += `Return only the JSON response:`;
  return prompt;
}
function parseAnalysisResponse(response) {
  try {
    const jsonMatch = response.match(/\{[\s\S]*\}/);
    if (!jsonMatch) {
      throw new Error("No JSON found in response");
    }
    const parsed = JSON.parse(jsonMatch[0]);
    return {
      effectiveness: parsed.effectiveness || "insufficient_data",
      summary: parsed.summary || "Analysis could not be completed.",
      journalTrends: parsed.journalTrends || "No journal trends identified.",
      taskTrends: parsed.taskTrends || "No task trends identified.",
      recommendations: parsed.recommendations || "Continue monitoring for more data."
    };
  } catch (error39) {
    console.error("Error parsing GPT analysis response:", error39);
    return generateMockAnalysis();
  }
}
function generateMockAnalysis() {
  return {
    effectiveness: "mixed_results",
    summary: "Mock analysis: This potion shows mixed results based on available data.",
    journalTrends: "Mock data shows average sentiment patterns.",
    taskTrends: "Mock data shows typical task completion patterns.",
    recommendations: "Continue monitoring this potion for more conclusive results."
  };
}
async function runWeeklyPotionAnalysis(userId) {
  const userPotions = await db.query.potions.findMany({
    where: and(eq(potions.userId, userId), eq(potions.isActive, true))
  });
  const analyses = [];
  for (const potion of userPotions) {
    try {
      const analysis = await analyzePotionEffectiveness(potion.id);
      await db.update(potions).set({
        gptAnalysis: JSON.stringify(analysis),
        updatedAt: new Date
      }).where(eq(potions.id, potion.id));
      analyses.push({
        potionId: potion.id,
        potionTitle: potion.title,
        analysis
      });
    } catch (error39) {
      console.error(`Error analyzing potion ${potion.id}:`, error39);
    }
  }
  return analyses;
}

